Actionscript.script:
/*
	Tactical Weapon Pack 2
	v1.0 - April 2019
	Find more games and asset packs at www.xwilkinx.com!
*/

import flash.events.MouseEvent;
import flash.net.URLRequest;
import flash.events.Event;
import flash.display.StageScaleMode;
import flash.display.MovieClip;
import flash.filters.DropShadowFilter;
import flash.filters.GlowFilter;
import flash.filters.BevelFilter;
import flash.display.SimpleButton;
import flash.display.StageAlign;

var bApplyFilters:Boolean = true;
var labels:Array = [
	"Home",
	"Pistols",
	"Machine Pistols",
	"SMGs (1)",
	"SMGs (2)",
	"Assault Rifles (1)",
	"Assault Rifles (2)",
	"Shotguns (1)",
	"Shotguns (2)",
	"High-Powered Rifles (1)",
	"High-Powered Rifles (2)",
	"LMGs (1)",
	"LMGs (2)",
	"Launchers",
	"Attachments"
]

stop();
mc_header.button_xwilkinx.addEventListener(MouseEvent.CLICK, onHeaderClicked);
mc_header.button_filters.addEventListener(MouseEvent.CLICK, onFiltersClicked);
button_prev.addEventListener(MouseEvent.CLICK, onPrevClicked);
button_next.addEventListener(MouseEvent.CLICK, onNextClicked);
updateFrame();

function onFiltersClicked(e:MouseEvent):void 
{
	bApplyFilters = !bApplyFilters;
	mc_header.mc_filters.mc_checkmark.visible = bApplyFilters;
	updateFrame();
}

function onHeaderClicked(e:MouseEvent):void 
{
	navigateToURL(new URLRequest("http://xwilkinx.com"), "_blank");
}

function onPrevClicked(e:MouseEvent):void 
{
	prevFrame();
	updateFrame();
}

function onNextClicked(e:MouseEvent):void 
{
	nextFrame();
	updateFrame();
}

function updateFrame():void 
{
	var maxPages:int = labels.length;
	button_prev.visible = currentFrame > 1;
	button_next.visible = currentFrame < maxPages;
	mc_text.t_page.text = String(currentFrame + "/" + maxPages + ": " + labels[currentFrame - 1].toUpperCase());
	/* Apply filters to items */
	if (currentFrame > 1)
	{
		for (var i = 0; i < numChildren; i ++)
		{
			var child:MovieClip = getChildAt(i) as MovieClip;
			if (child)
			{
				if (child.name != "mc_header" && child.name != "mc_text")
				{
					if (child.optic)
					{
						child.optic.stop();
					}
					if (bApplyFilters)
					{
						child.filters = [
							new BevelFilter(3, 45, 0xFFFFFF, 0.5, 0x000000, 0.5, 1.5, 1.5, 0.35, 1),
							new GlowFilter(0x000000, 1, 2, 2, 1, 1, true),
							new DropShadowFilter(12, 45, 0x000000, 0.5, 8, 8, 0.5, 3)
						];
					}
					else 
					{
						child.filters = [];
					}
				}
			}
		}
	}
}
